description:
Verenigd Koninkrijk / Duitsland
Drama
130 minuten

geregisseerd door Roland Emmerich
met Rhys Ifans, Vanessa Redgrave en Jamie Campbell Bower

Edward de Vere (Rhys Ifans), de 17e graaf van Oxford is een gelauwerd dichter en toneelschrijver voor Koningin Elizabeth I (Vanessa Redgrave) in de 16e eeuw. In de twintigste eeuw ontstaan er geruchten dat De Vere de werkelijke schrijver van de werken van William Shakespeare is.




